Blue-Tongue Films is an Australian film collective and [[production company]],<ref>{{Cite web|url=https://www.imdb.com/company/co0062793/|title=Blue-Tongue Films [au]|website=IMDb|access-date=2016-07-27}}</ref> composed of filmmakers [[Kieran Darcy-Smith]], [[Luke Doolan]], [[Joel Edgerton]], [[Nash Edgerton]], [[Mirrah Foulkes]], Sean Kruck, [[David Michôd]] and [[Spencer Susser]].<ref>{{cite web|last=Hawkins|first=Joanne|title=Men of the Year 2010 Winners – Blue-Tongue Films|url=https://www.gq.com.au/men+of+the+year/2010+winners/blue+tongue+films,14551|publisher=gq.com.au|accessdate=18 March 2013|author2=Dawe, James|date=3 December 2010}}</ref><ref>{{cite web|last=Cieply|first=Michael|title=Filmmakers With Shared Grit|url=https://www.nytimes.com/2010/02/18/movies/18tongue.html|work=nytimes.com|accessdate=18 March 2013|date=17 February 2010}}</ref><ref>{{cite web|last=Erbland|first=Kate|title=Joel Edgerton to Star in Twisty Thriller 'Felony' From His Own Script|url=http://www.filmschoolrejects.com/news/joel-edgerton-felony-kerbl.php|publisher=filmschoolrejects.com|accessdate=18 March 2013|date=16 May 2012}}</ref> Founded in 1996, Blue-Tongue has created a number of feature films as Animal Kingdom, Hesher, The Square, Wish You Were Here, and The Gift,<ref>{{cite web|title=Joel Top 50 2012 Arts – Edgerton and Blue-Tongue Films|url=http://www.theaustralian.com.au/top50/2012/joel-edgerton/story-fndljfny-1226353136961|publisher=theaustralian.com.au|accessdate=18 March 2013}}</ref> several short films, including Bear, Crossbow, [[The Magician (2005 film)|The Magician]], I Love Sarah Jane, Miracle Fish and Spider, as well as music videos for artists such as [[Ben Lee]], [[Bob Dylan]], [[Brandon Flowers]], [[Empire of the Sun (band)|Empire of the Sun]], [[Eskimo Joe]], [[Evermore (band)|Evermore]], [[Lana Del Rey]], [[Missy Higgins]], [[Rahzel]], and [[The Veronicas]].
